import React, { useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

export default function Dashboard() {

    const navigate = useNavigate();

    useEffect(() => {
        // Set axios default with credentials inside useEffect
        axios.defaults.withCredentials = true;
        
        axios.get('http://localhost:3001/dashboardapi/dashboard')
            .then(result => {
                console.log(result);
                if (result.data !== "success") {
                    navigate('/');
                }
            })
            .catch(err => {
                console.log('Error during preview verification:', err);
                
            });
    }, []);

    // Handle log out (add any log out logic here)
    const handleLogout = () => {
        // Log out logic or call a logout API endpoint
        console.log("Logging out...");
        navigate('/'); // Redirect to the login page
    };

    return (
        <>
            <div className="row row-cols-1 row-cols-md-4 g-4 m-2">
                <div className="col">
                    <div className="card">
                        {/* Replace the img src placeholder */}
                        <img src="https://via.placeholder.com/150" className="card-img-top" alt="Department" />
                        <div className="card-body">
                            <h5 className="card-title">Department</h5>
                        </div>
                    </div>
                </div>
                <div className="col">
                    <div className="card">
                        <img src="https://via.placeholder.com/150" className="card-img-top" alt="Total Students" />
                        <div className="card-body">
                            <h5 className="card-title">Total Students</h5>
                        </div>
                    </div>
                </div>
                <div className="col">
                    <div className="card">
                        <img src="https://via.placeholder.com/150" className="card-img-top" alt="Total Boys" />
                        <div className="card-body">
                            <h5 className="card-title">Total Boys</h5>
                        </div>
                    </div>
                </div>
                <div className="col">
                    <div className="card">
                        <img src="https://via.placeholder.com/150" className="card-img-top" alt="Total Girls" />
                        <div className="card-body">
                            <h5 className="card-title">Total Girls</h5>
                        </div>
                    </div>
                </div>
            </div>
            <div>
                <hr />
                <h2 className="mb-3 text-center">Student's Attendance Details</h2>
                <ul className="nav justify-content-center text-black">
                    <li className="nav-item text-center">
                        <h1>Welcome Sagar Raj</h1>
                    </li>
                    <li className="nav-item text-center mx-3 mt-2">
                        {/* Log out button with event handler  */}
                        <button className='btn btn-danger'onClick={handleLogout} >Log Out</button>
                    </li>
                </ul>
            </div>
            <br />
            <div className="d-flex justify-content-center mt-4">
                <Link to="/attendance" type="button" className="btn btn-danger mx-3">Add New</Link>
                <Link to="/preview" type="button" className="btn btn-success mx-3">Preview</Link>
            </div>
        </>
    )
}
